export default class MgmForm{
    constructor(search_address, select_day, select_hour, select_category, check_max, check_min, group_day, group_hour, day_timeline, week_timeline, compare_active, cont_compare, top_info){
        this.search_address = search_address;
        this.select_day = select_day;
        this.select_hour = select_hour;
        this.select_category = select_category;
        this.check_max = check_max;
        this.check_min = check_min;
        this.group_day = group_day;
        this.group_hour = group_hour;
        this.day_timeline = day_timeline;
        this.week_timeline = week_timeline;
        this.compare_active = compare_active;
        //this.cont_compare = cont_compare;
        this.top_info = top_info;
    }


    findQuery(){
        $('#btn_search').click(function(event){
            event.preventDefault();
            console.log(this.select_day);
            console.log(this.select_hour);
            console.log(this.select_category);
            console.log(this.check_max);
            if(this.select_day != 0 & this.select_hour == 0 & this.select_category == 0 & this.check_max == true){
                console.log('query 1');
            }else if(select_day != 0 & select_hour == 0 & select_category == 1 & check_min == true){
                console.log('query 2');
            }else if(select_day == 0 & select_hour == 0 & select_category == 1 & group_day == true & check_max == true){
                console.log('query 3');
            }else if(select_day == 0 & select_hour == 0 & select_category == 1 & group_day == true & check_min == true){
                console.log('query 4');
            }else if(select_day == 0 & select_hour == 0 & select_category == 1 & group_hour == true & check_max == true){
                console.log('query 5');
            }else if(select_day == 0 & select_hour == 0 & select_category == 1 & group_hour == true & check_min == true){
                console.log('query 6');
            }else if(select_day != 0 & select_hour == 0 & select_category == 2 & check_max == true){
                console.log('query 7');
            }else if(select_day != 0 & select_hour == 0 & select_category == 2 & check_min == true){
                console.log('query 8');
            }else if(select_day == 0 & select_hour == 0 & select_category == 2 & group_day == true & check_max == true){
                console.log('query 9');
            }else if(select_day == 0 & select_hour == 0 & select_category == 2 & group_day == true & check_min == true){
                console.log('query 10');
            }else if(select_day == 0 & select_hour == 0 & select_category == 2 & group_hour == true & check_max == true){
                console.log('query 11');
            }else if(select_day == 0 & select_hour == 0 & select_category == 2 & group_hour == true & check_min == true){
                console.log('query 12');
            }else if(week_timeline == true & select_category == 1 ){
                console.log('query 13');
            }else if(select_day != 0 & day_timeline == true & select_category == 1 ){
                console.log('query 14');
            }else if(select_category == 2 & check_max == true & top_info > 0){
                console.log('query 15');
            }else if(select_category == 2 & check_min == true & top_info > 0){
                console.log('query 16');
            }else if(select_category == 1 & check_max == true & top_info > 0){
                console.log('query 17');
            }else if(select_category == 1 & check_min == true & top_info > 0){
                console.log('query 18');
            }    
            return false;
        });
    }

    controlForm(){

        // 24 hrs timeline
        $('#day_timeline').click(function(event){
            if($('#day_timeline').prop('checked') == true){
              $('#week_timeline').prop('disabled', true);
              $('#select_hour').prop('disabled', true);
              $('#check_max').prop('disabled', true);
              $('#check_min').prop('disabled', true);
              $('#group_day').prop('disabled', true);
              $('#group_hour').prop('disabled', true);
              $('#top_info').prop('disabled', true);
              $('#compare_active').prop('disabled', true);
            }if($('#day_timeline').prop('checked') == false){
              $('#week_timeline').prop('disabled', false);
              $('#select_hour').prop('disabled', false);
              $('#check_max').prop('disabled', false);
              $('#check_min').prop('disabled', false);
              $('#group_day').prop('disabled', false);
              $('#group_hour').prop('disabled', false);
              $('#top_info').prop('disabled', false);
              $('#compare_active').prop('disabled', false);
            }
          });

          //week timeline
          $('#week_timeline').click(function(event){
            if($('#week_timeline').prop('checked') == true){
              $('#day_timeline').prop('disabled', true);
              $('#select_day').prop('disabled', true);
              $('#select_hour').prop('disabled', true);
              $('#check_max').prop('disabled', true);
              $('#check_min').prop('disabled', true);
              $('#group_day').prop('disabled', true);
              $('#top_info').prop('disabled', true);
              $('#group_hour').prop('disabled', true);
              $('#compare_active').prop('disabled', true);
            }if($('#week_timeline').prop('checked') == false){
              $('#day_timeline').prop('disabled', false);
              $('#select_day').prop('disabled', false);
              $('#select_hour').prop('disabled', false);
              $('#check_max').prop('disabled', false);
              $('#check_min').prop('disabled', false);
              $('#group_day').prop('disabled', false);
              $('#group_hour').prop('disabled', false);
              $('#top_info').prop('disabled', false);
              $('#compare_active').prop('disabled', false);
            }
          });

