          //Max
          $('#check_max').click(function(event){
            if($('#check_max').prop('checked') == true){
              $('#day_timeline').prop('disabled', true);
              $('#week_timeline').prop('disabled', true);
              $('#compare_active').prop('disabled', true);
              $('#check_min').prop('disabled', true);
            }if($('#check_max').prop('checked') == false){
              $('#day_timeline').prop('disabled', false);
              $('#week_timeline').prop('disabled', false);
              $('#compare_active').prop('disabled', false);
              $('#check_min').prop('disabled', false);
            }
          });

          //Min
          $('#check_min').click(function(event){
            if($('#check_min').prop('checked') == true){
              $('#day_timeline').prop('disabled', true);
              $('#week_timeline').prop('disabled', true);
              $('#compare_active').prop('disabled', true);
              $('#check_max').prop('disabled', true);
            }if($('#check_min').prop('checked') == false){
              $('#day_timeline').prop('disabled', false);
              $('#week_timeline').prop('disabled', false);
              $('#compare_active').prop('disabled', false);
              $('#check_max').prop('disabled', false);
            }
          });


          //Group by day
          $('#group_day').click(function(event){
            if($('#group_day').prop('checked') == true){
              $('#day_timeline').prop('disabled', true);
              $('#week_timeline').prop('disabled', true);
              $('#select_day').prop('disabled', true);
              $('#select_hour').prop('disabled', true);
              $('#group_hour').prop('disabled', true);
              $('#compare_active').prop('disabled', true);
              $('#top_info').prop('disabled', true);
              $('#cont-compare').css('display', 'block');
            }if($('#group_day').prop('checked') == false){
              $('#day_timeline').prop('disabled', false);
              $('#week_timeline').prop('disabled', false);
              $('#select_day').prop('disabled', false);
              $('#select_hour').prop('disabled', false);
              $('#group_hour').prop('disabled', false);
              $('#compare_active').prop('disabled', false);
              $('#top_info').prop('disabled', false);
              $('#cont-compare').css('display', 'none');
            }
          });

          //Group by hour
          $('#group_hour').click(function(event){
            if($('#group_hour').prop('checked') == true){
              $('#day_timeline').prop('disabled', true);
              $('#week_timeline').prop('disabled', true);
              $('#select_day').prop('disabled', true);
              $('#select_hour').prop('disabled', true);
              $('#group_day').prop('disabled', true);
              $('#compare_active').prop('disabled', true);
              $('#top_info').prop('disabled', true);
              $('#cont-compare').css('display', 'block');
            }if($('#group_hour').prop('checked') == false){
              $('#day_timeline').prop('disabled', false);
              $('#week_timeline').prop('disabled', false);
              $('#select_day').prop('disabled', false);
              $('#select_hour').prop('disabled', false);
              $('#group_day').prop('disabled', false);
              $('#compare_active').prop('disabled', false);
              $('#top_info').prop('disabled', false);
              $('#cont-compare').css('display', 'none');
            }
          });


           //top
           $('#top_info').click(function(event){
            if($('#top_info').val() > 0){
              $('#day_timeline').prop('disabled', true);
              $('#week_timeline').prop('disabled', true);
              $('#select_day').prop('disabled', true);
              $('#select_hour').prop('disabled', true);
              $('#group_day').prop('disabled', true);
              $('#group_hour').prop('disabled', true);
              $('#compare_active').prop('disabled', true);
              $('#cont-compare').css('display', 'block');
            }if($('#top_info').val() == 0 ){
              $('#day_timeline').prop('disabled', false);
              $('#week_timeline').prop('disabled', false);
              $('#select_day').prop('disabled', false);
              $('#select_hour').prop('disabled', false);
              $('#group_day').prop('disabled', false);
              $('#group_hour').prop('disabled', false);
              $('#compare_active').prop('disabled', false);
              $('#cont-compare').css('display', 'none');
            }
          });

